import React, { Component } from 'react';
import logo from './logo.png';

class CompanyRegister extends Component {
    render() {
        return (
            <div>
                <div>
                    <img src={logo} alt=""/>
                </div>
            </div>
        );
    }
}

export default CompanyRegister;
